  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Coastal
  Maine National Wildlife Refuge outlines Refuge accomplishments during the 1968 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds- is also covered. The Refuge development and maintenance section
  discusses physical developments. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, and safety. N-R
  forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
